create table Loan(
    Amount  number(6),
    Loan_Date   DATE,
    Loan_Title  varchar(40),
    Risk_Score  number(3),
    Debt_To_Income_Ratio    float,
    Zipcode     number(5),
    State   varchar(2),
    Employment_Length   number(2),
    Policy_Code     number(2),
    primary key (Loan_Title)
);


select count (*) from Loan;